"use client";

import { useState, useEffect } from "react";
import { useWebSocketStore } from "../../store/webSocketStore";
import { motion, AnimatePresence } from "framer-motion";

// Paste your two base64 strings below (ensure they include the data URI prefix)
const testBase64Images = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
];

export default function MediaGallery() {
    // Retrieve images and GLB file from global state.
    const images = useWebSocketStore((state) => state.images);
    const glbModels = useWebSocketStore((state) => state.glbModels);
    const addImage = useWebSocketStore((state) => state.addImage);

    // For testing: if no images exist, add our test base64 images.
    useEffect(() => {
        if (images.length === 0) {
            testBase64Images.forEach((img) => addImage(img));
        }
    }, [images, addImage]);

    // totalSlides: number of images plus one slide for the GLB file (if available)
    const totalSlides = images.length + (glbModels.length > 0 ? 1 : 0);
    const [currentSlide, setCurrentSlide] = useState(0);

    // Handlers to change slides
    const nextSlide = () => {
        setCurrentSlide((prev) => (prev + 1) % totalSlides);
    };

    const prevSlide = () => {
        setCurrentSlide((prev) => (prev - 1 < 0 ? totalSlides - 1 : prev - 1));
    };

    // Listen for arrow key presses
    useEffect(() => {
        const handleKeyDown = (e: KeyboardEvent) => {
            if (e.key === "ArrowRight") {
                nextSlide();
            } else if (e.key === "ArrowLeft") {
                prevSlide();
            }
        };
        window.addEventListener("keydown", handleKeyDown);
        return () => window.removeEventListener("keydown", handleKeyDown);
    }, [totalSlides]);

    // Framer Motion variants for a fade/scale transition
    const variants = {
        initial: { opacity: 0 },
        animate: { opacity: 1 },
        exit: { opacity: 0 },
    };

    return (
        <div className="bg-black w-full h-full overflow-hidden bg-black flex items-center justify-center">
            <AnimatePresence mode="wait">
                {currentSlide < images.length ? (
                    <motion.img
                        key={`slide-${currentSlide}`}
                        src={images[currentSlide]}
                        alt={`Slide ${currentSlide}`}
                        variants={variants}
                        initial="initial"
                        animate="animate"
                        exit="exit"
                        transition={{ duration: 0.3 }}
                        className="absolute top-0 left-0 w-[100vw] h-[100vh]"
                    />
                ) : (
                    <motion.div
                        key="glb-slide"
                        variants={variants}
                        initial="initial"
                        animate="animate"
                        exit="exit"
                        transition={{ duration: 0.3 }}
                        className="absolute top-0 left-0 w-full h-full flex items-center justify-center"
                    >
                        <a
                            href={glbModels[0]}
                            target="_blank"
                            rel="noopener noreferrer"
                            className="text-2xl text-white bg-white bg-opacity-20 py-2 px-4 rounded"
                        >
                            View 3D Model (GLB)
                        </a>
                    </motion.div>
                )}
            </AnimatePresence>
        </div>
    );
}
